def get_hash(ground, module, text):
    index = 0
    result = 0
    while index < len(text) - 1:
        result += ord(text[index])
        result *= ground
        if result >= module:
            result %= module
        index += 1
    result += ord(text[index])
    result %= module
    return result


def test_get_hash():
    result = get_hash(123, 100003, 'HaSH')
    assert result == 56156, f'Wrong answer: {result}'
    result = get_hash(357, 240058846, '')
    assert result == 224328115, f'Wrong answer: {result}'
    print('Все тесты пройдены!')


if __name__ == '__main__':
    test_get_hash()
